import { SendScript } from "../SendScript";
import React, { useState, useEffect } from 'react';


function UploadScript() {

    const script = "Never gonna give you up";

    return (
        <div>
            <button onClick={(e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => SendScript(script)}
                disabled={script === null}>
                Upload Script
            </button>
        </div>
    );
}

export default UploadScript;
